import NavItem from './NavItem';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

const Nav = () => {
    return(
        <>
        <Router>
            <Routes>
                <Route path="/" exact element={<NavItem url={'/posts'} linkName={'Posts'}/>} />
                <Route path="/a"  element={<NavItem url={'/aa'} linkName={'dd'}/>} />
                <Route path="/b" element={<NavItem url={'/about'} linkName={'About'}/>} />
            </Routes>
        </Router>
        </>
    )
}


export default Nav;
